import { useState } from "react";

export interface TaskInterface {
  id: number;
  task: string;
  status: boolean;
}

import React from "react";

export const [TASKS, setTASKS] = useState<TaskInterface[]>([
  {
    id: 0,
    task: "Task1",
    status: true,
  },
  {
    id: 1,
    task: "Task2",
    status: false,
  },
  {
    id: 2,
    task: "Task3",
    status: false,
  },
]);
